00046         public struct DelayedRegistrationItem
00047         {
00048             public object comp;
00049             public bool register;
00050             public DelayedRegistrationItem(object comp, bool register) { this.comp = comp; this.register = register; }
00051         }
00052         public static Queue<DelayedRegistrationItem> pendingRegistrations = new Queue<DelayedRegistrationItem>();
00056         public static void RegisterCallbackInterfaces(object comp, bool register = true, bool delay = false)
00057         {
00058 
00059             if (delay || callbacksLocked)
00060             {
00061                 pendingRegistrations.Enqueue(new DelayedRegistrationItem(comp, register));
00062                 return;
00063             }
00064             //if ((comp as Object) && register == false)
00065             //  Debug.LogError((comp as Object).name + "  UNREGISTER");
00066 
00067             CallbackUtilities.RegisterInterface(onPreUpdates, comp, register);
00068             CallbackUtilities.RegisterInterface(onPostUpdates, comp, register);
00069 
00070             CallbackUtilities.RegisterInterface(onPreLateUpdates, comp, register);
00071             CallbackUtilities.RegisterInterface(onPostLateUpdates, comp, register);
00072 
00073             CallbackUtilities.RegisterInterface(onIncrementFrames, comp, register);
00074 
00075             CallbackUtilities.RegisterInterface(onPreSimulates, comp, register);
00076             CallbackUtilities.RegisterInterface(onPostSimulates, comp, register);
00077 
00078             CallbackUtilities.RegisterInterface(onSnapshots, comp, register);
00079             CallbackUtilities.RegisterInterface(onInterpolates, comp, register);
00080             CallbackUtilities.RegisterInterface(onPreQuits, comp, register);
00081         }
