00085         private static bool callbacksLocked;
00086 
00087         public static bool CallbacksLocked
00088         {
00089             set
00090             {
00091                 callbacksLocked = value;
00092 
00093                 if (!value)
00094                 {
00096                     while (pendingRegistrations.Count > 0)
00097                     {
00098                         var que = pendingRegistrations.Dequeue();
00099                         RegisterCallbackInterfaces(que.comp, que.register, false);
00100                     }
00101 
00102                     while (postCallbackActions.Count > 0)
00103                     {
00104                         postCallbackActions.Dequeue().Invoke();
00105                     }
00106                 }
00107             }
00108         }
